  .rbx-btn-primary-lg:hover, .rbx-btn-primary-lg:focus
  {
    background-color: rgba(255, 192, 203, 0.5);
  }
      
    @keyframes rainbow
  {
    0% {background-color: #d1b2ff;
    border-color: #d1b2ff;
  }


  28%
  {
    background-color: #8c47f4;
    border-color: #8c47f4;
  }

  42%
  {
    background-color: #731bf7;
    border-color: #731bf7;
  }

  56%
  {
    background-color: #6300f7;
    border-color: #6300f7;
  }

  80%
  {
    background-color: #731bf7;
    border-color: #731bf7;
  }

  94%
  {
    background-color: #8c47f4;
    border-color: #8c47f4;
  }

  100%
  {
